import React from 'react';
import './App.css';
import Routes from "./routes/Routes";
import SideBar from "./component/Nav/SideBar"
function App() {
  return (
    <div className="App" style={{ display: "flex" }}>
      {this.state.connected ? (<SideBar/> ) : ""}
        
    
      <Routes/>
    </div>
  );
}

export default App;
